// 1. MOOD-BASED BIOMETRIC INTEGRATION
import { useEffect, useState } from "react";

const BiometricMoodDetection = () => {
  const [heartRate, setHeartRate] = useState(null);
  const [stressLevel, setStressLevel] = useState('low');

  // Simulate biometric data (in real app, integrate with device sensors)
  useEffect(() => {
    const simulateBiometrics = () => {
      const hr = Math.floor(Math.random() * 30) + 60; // 60-90 BPM
      setHeartRate(hr);

      if (hr > 80) setStressLevel('high');
      else if (hr > 70) setStressLevel('medium');
      else setStressLevel('low');
    };

    const interval = setInterval(simulateBiometrics, 5000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="biometric-panel">
      <h3>ü´Ä Real-time Mood Detection</h3>
      <div className="metrics">
        <div className="metric">
          <span>Heart Rate: {heartRate} BPM</span>
          <div className={`stress-indicator ${stressLevel}`}>
            Stress: {stressLevel}
          </div>
        </div>
      </div>
    </div>
  );
};

// 2. ADVANCED ANALYTICS & PREDICTIONS
const FocusAnalytics = ({ sessions }) => {
  const [prediction, setPrediction] = useState(null);
  const [insights, setInsights] = useState([]);

  useEffect(() => {
    if (sessions.length > 5) {
      // AI-powered insights
      const avgFocus = sessions.reduce((acc, s) => acc + s.focusScore, 0) / sessions.length;
      const trend = calculateTrend(sessions);

      setInsights([
        `Your focus improves by ${trend}% each week`,
        `Best focus time: ${getBestTimeSlot(sessions)}`,
        `Optimal session length for you: ${getOptimalDuration(sessions)} min`
      ]);

      setPrediction(predictNextSession(sessions));
    }
  }, [sessions]);

  return (
    <div className="analytics-dashboard">
      <h3>üìä AI Focus Analytics</h3>
      <div className="insights-grid">
        {insights.map((insight, idx) => (
          <div key={idx} className="insight-card">
            <span className="insight-icon">üí°</span>
            <p>{insight}</p>
          </div>
        ))}
      </div>
      {prediction && (
        <div className="prediction-card">
